import axios from "axios";
import { GET_STUDENTS } from "./action-types";

export const getStudents = () => async (dispatch) => {
  const res = await axios.get("/api/student/all");
  dispatch({
    type: GET_STUDENTS,
    payload: res.data,
  });
};
